import React from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import App from './App';
import Header from './components/Header/Header';
const Routes = () => {
    return (
        <Router>
            <Header></Header>
            <Switch>
                <Route exact path="/" component={App}></Route>
            </Switch>
        </Router>
    );
};

export default Routes;
